snippet.sync_client:
package com.example.usage;

import com.seed.accept.SeedAcceptClient;

public class Example {
    public static void main(String[] args) {
        SeedAcceptClient client = SeedAcceptClient
            .builder()
            .token("<token>")
            .build();

        client.service().endpoint();
    }
}

